 font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;">Một chiếc laptop mạnh mẽ hay một chiếc máy tính bảng linh hoạt, dù trong bất cứ vai trò nào, Microsoft Surface Pro 9 vẫn thể hiện vô cùng xuất sắc, cho bạn sản phẩm có hiệu suất cao, thời lượng pin cả ngày và một thiết kế cực chất mà ai cũng phải ngước nhìn.</strong></p><p><strong style="box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: 0px 0px rgb(255, 255, 255); font-size: 16px; line-height: inherit; color: rgb(73, 80, 87); font-family: Roboto, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;"><img src="http://localhost:8000/upload/1709889102347-microSurfacePro9.png" alt="surface1" width="665" height="443" style="display: block; margin-left: auto; margin-right: auto;"></strong></p><h3 style="box-sizing: inherit; margin: 0px 0px 11px; padding: 0px; border: 0px; font-size: 16px; font-weight: 700; vertical-align: baseline; background: 0px 0px rgb(255, 255, 255); font-family: Roboto, sans-serif; color: rgb(33, 37, 41); line-height: 24px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; text-align: justify;"><strong style="box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: 0px 0px; font-size: inherit; line-height: inherit;">Thỏa sức sáng tạo trên màn hình cảm ứng tràn viền</strong></h3><p style="box-sizing: inherit; margin: 0px 0px 11px; padding: 0px; border: 0px; font-size: 16px; font-weight: 400; vertical-align: baseline; background: 0px 0px rgb(255, 255, 255); color: rgb(73, 80, 87); line-height: 24px; font-family: Roboto, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; text-align: justify;">Sẽ thật thú vị khi cầm trên tay và thao tác trực tiếp lên màn hình<span>&nbsp;</span><a href="https://fptshop.com.vn/may-tinh-xach-tay/microsoft-surface-pro-9-i5-1235u" style="box-sizing: inherit; margin: 0px; padding: 0px; font-size: 16px; vertical-align: baseline; background: 0px 0px transparent; outline: 0px; text-decoration: none; color: rgb(1, 104, 250); cursor: pointer;">Surface Pro 9</a>. Bạn sẽ có một thiết bị màn hình tuyệt đẹp với độ phân giải 2880 x 1920 pixels. Dù rất nhỏ gọn nhưng Surface Pro 9 vẫn có màn hình kích thước 13 inch, tỉ lệ 3:2 cho diện tích hiển thị cực rộng. Với chuẩn màu sRGB và tần số quét lên tới 120Hz, mọi thứ xuất hiện trước mắt bạn đều thật sống động và mượt mà. Không chỉ hiển thị xuất sắc, màn hình này còn hỗ trợ cảm ứng 10 điểm và tương thích với bút cảm ứng. Đối với công việc sáng tạo, hội họa, phụ kiện bút Surface Slim Pen 2 cho trải nghiệm thực tế như đang viết, vẽ trên giấy để bạn nhanh chóng ghi lại ý tưởng mọi lúc mọi nơi.</p><p style="box-sizing: inherit; margin: 0px 0px 11px; padding: 0px; border: 0px; font-size: 16px; font-weight: 400; vertical-align: baseline; background: 0px 0px rgb(255, 255, 255); color: rgb(73, 80, 87); line-height: 24px; font-family: Roboto, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; text-align: justify;"><img src="https://images.fpt.shop/unsafe/filters:quality(90)/fptshop.com.vn/Uploads/images/2015/0511/surface-pro-9-3.jpg" alt="surface2" width="608" height="405" style="display: block; margin-left: auto; margin-right: auto;"></p><h3 style="box-sizing: inherit; margin: 0px 0px 11px; padding: 0px; border: 0px; font-size: 16px; font-weight: 700; vertical-align: baseline; background: 0px 0px rgb(255, 255, 255); font-family: Roboto, sans-serif; color: rgb(33, 37, 41); line-height: 24px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; text-align: justify;"><strong style="box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: 0px 0px; font-size: inherit; line-height: inherit;">Thiết kế khác biệt, cao cấp và linh hoạt</strong></h3><p style="box-sizing: inherit; margin: 0px 0px 11px; padding: 0px; border: 0px; font-size: 16px; font-weight: 400; vertical-align: baseline; background: 0px 0px rgb(255, 255, 255); color: rgb(73, 80, 87); line-height: 24px; font-family: Roboto, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; text-align: justify;">Thiết kế, sự sang chảnh, tính công nghệ và khí chất riêng của Surface Pro 9 là điều bạn không tìm thấy trên bất cứ sản phẩm nào khác. Vẫn là một sản phẩm đẹp như kiệt tác, phần giá đỡ thông minh, logo Microsoft tinh tế thu hút mọi ánh nhìn. Surface Pro 9 đáp ứng hoàn hảo mọi nhu cầu trong một thiết kế mỏng nhẹ không tưởng với trọng lượng chỉ 879 gram và độ mỏng 9,3mm. Làm từ kim loại cao cấp, khả năng tương thích với nhiều phụ kiện, Surface Pro 9 vừa đẹp lại vừa tiện dụng. Việc sử dụng bàn phím rời hay bút Surface Pen sẽ biến Surface Pro 9 thành một sản phẩm đa năng hơn bao giờ hết.</p><p style="box-sizing: inherit; margin: 0px 0px 11px; padding: 0px; border: 0px; font-size: 16px; font-weight: 400; vertical-align: baseline; background: 0px 0px rgb(255, 255, 255); color: rgb(73, 80, 87); line-height: 24px; font-family: Roboto, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; text-align: justify;"><img src="https://images.fpt.shop/unsafe/filters:quality(90)/fptshop.com.vn/Uploads/images/2015/0511/surface-pro-9-8.jpg" alt="surface3" width="607" height="404" style="display: block; margin-left: auto; margin-right: auto;"></p>')
