t-decoration-color: initial;">Đặc điểm nổi bật của Lenovo Gaming Legion 5 16IRX9 i7-14650HX (83DG004YVN)</h2><div class="card-body" style="box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 14px; font-weight: 400; vertical-align: baseline; background: 0px 0px; -webkit-box-flex: 1; flex: 1 1 auto; color: rgb(68, 75, 82); font-family: Roboto, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;"><div class="st-pd-content" style="box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 14px; font-weight: 400; vertical-align: baseline; background: 0px 0px;"><p style="box-sizing: inherit; margin: 0px 0px 11px; padding: 0px; border: 0px; font-size: 16px; font-weight: 400; vertical-align: baseline; background: 0px 0px; color: rgb(73, 80, 87); line-height: 24px; text-align: justify;"><strong style="box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: 0px 0px; font-size: inherit; line-height: inherit;">Được trang bị “siêu chip” Intel Core i7 14650HX thế hệ mới nhất cực mạnh và chip AI LA1 riêng biệt, Lenovo Gaming Legion 5 16IRX9 cho bạn chơi game với tốc độ nhanh chưa từng thấy trên một chiếc laptop nhỏ gọn. Tha hồ thể hiện kỹ năng với màn hình lớn 15,6 inch 2K 165Hz đầy chuyên nghiệp.</strong></p><p style="box-sizing: inherit; margin: 0px 0px 11px; padding: 0px; border: 0px; font-size: 16px; font-weight: 400; vertical-align: baseline; background: 0px 0px; color: rgb(73, 80, 87); line-height: 24px; text-align: justify;"><strong style="box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: 0px 0px; font-size: inherit; line-height: inherit;"><img src="http://localhost:8000/upload/1710078977557-lenovo-legion5-1.png" alt="example" style="display: block; margin-left: auto; margin-right: auto;"></strong></p><p style="box-sizing: inherit; margin: 0px 0px 11px; padding: 0px; border: 0px; font-size: 16px; font-weight: 400; vertical-align: baseline; background: 0px 0px; color: rgb(73, 80, 87); line-height: 24px; text-align: justify;"><strong style="box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: 0px 0px; font-size: inherit; line-height: inherit;"><h3 style="box-sizing: inherit; margin: 0px 0px 11px; padding: 0px; border: 0px; font-size: 16px; font-weight: 700; vertical-align: baseline; background: 0px 0px rgb(255, 255, 255); font-family: Roboto, sans-serif; color: rgb(33, 37, 41); line-height: 24px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; text-align: justify;"><strong style="box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: 0px 0px; font-size: inherit; line-height: inherit;">Hiệu năng vượt xa những gì bạn tưởng tượng</strong></h3><p style="box-sizing: inherit; margin: 0px 0px 11px; padding: 0px; border: 0px; font-size: 16px; font-weight: 400; vertical-align: baseline; background: 0px 0px rgb(255, 255, 255); color: rgb(73, 80, 87); line-height: 24px; font-family: Roboto, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; text-align: justify;">Sức mạnh của một chiếc laptop di động giờ đây khủng khiếp hơn những gì bạn nghĩ rất nhiều. Bộ vi xử lý Intel Core i7 14650HX có mặt trên<span>&nbsp;</span><a href="https://fptshop.com.vn/may-tinh-xach-tay/lenovo-gaming-legion-5-16irx9-i7-14650hx" target="_blank" style="box-sizing: inherit; margin: 0px; padding: 0px; font-size: 16px; vertical-align: baseline; background: 0px 0px transparent; outline: 0px; text-decoration: none; color: rgb(1, 104, 250); cursor: pointer;">Lenovo Gaming Legion 5 16IRX9</a><span>&nbsp;</span>xứng đáng được gọi là một “siêu chip máy tính” với 16 nhân 24 luồng và tốc độ khó tin lên tới 5.2 GHz. Điều này đồng nghĩa với việc Lenovo Gaming Legion 5i có sức mạnh tương đương với những máy tính chơi game để bàn hàng đầu hiện nay. Ngay cả những tác vụ nặng, các ứng dụng đòi hỏi khắt khe về cấu hình hay cả những tựa game đời mới cũng không thể làm khó được chiếc laptop này, một sản phẩm có đủ sức mạnh đáp ứng mọi nhu cầu.</p><img src="http://localhost:8000/upload/1710078977561-lenovo-legion5-3.png" alt="example" style="display: block; margin-left: auto; margin-right: auto;"><h3 style="box-sizing: inherit; margin: 0px 0px 11px; padding: 0px; border: 0px; font-size: 16px; font-weight: 700; vertical-align: baseline; background: 0px 0px rgb(255, 255, 255); font-family: Roboto, sans-serif; color: rgb(33, 37, 41); line-height: 24px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; text-align: justify;"><strong style="box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: 0px 0px; font-size: inherit; line-height: inherit;">Giảm nhiệt nhanh chóng, chơi game liên tục</strong></h3><p style="box-sizing: inherit; margin: 0px 0px 11px; padding: 0px; border: 0px; font-size: 16px; font-weight: 400; vertical-align: baseline; background: 0px 0px rgb(255, 255, 255); color: rgb(73, 80, 87); line-height: 24px; font-family: Roboto, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; text-align: justify;">Hệ thống tản nhiệt Legion ColdFront Hyper trên Lenovo Gaming Legion 5 16IRX9 là một bước đột phá cho máy tính chơi game. Được thiết kế dành riêng cho game thủ, hệ thống tản nhiệt này có các quạt quay hướng vào trong, hoạt động song song để đẩy khí nóng ra phía sau máy một cách hiệu quả. Việc tản nhiệt ra phía sau là một giải pháp thông minh khi tay bạn sẽ không bị nóng trong lúc chơi game dù là đang thao tác với bàn phím hay chuột. Lenovo Gaming Legion 5 còn sử dụng một buồng kín chuyên dụng để chứa nhiệt, giúp duy trì nhiệt độ tối ưu, giảm nhiệt độ xuống 2 độ C, đồng thời giảm tiếng ồn xuống 2dB so với thế hệ trước.</p><p style="box-sizing: inherit; margin: 0px 0px 11px; padding: 0px; border: 0px; font-size: 16px; font-weight: 400; vertical-align: baseline; background: 0px 0px rgb(255, 255, 255); color: rgb(73, 80, 87); line-height: 24px; font-family: Roboto, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; text-align: center;"><img alt="Lenovo Gaming Legion 5 16IRX9 (ảnh 4)" class="" src="https://images.fpt.shop/unsafe/filters:quality(90)/fptshop.com.vn/Uploads/images/2015/0511/Lenovo-Gaming-Legion-5-16IRX9-3.jpg" style="box-sizing: inherit; margin: 0px auto; padding: 0px; border: 0px; font-size: 16px; font-weight: 400; vertical-align: middle; background: 0px 0px; max-width: 100%; border-radius: 6px; width: 665px; height: auto !important; display: block;"></p><h3 style="box-sizing: inherit; margin: 0px 0px 11px; padding: 0px; border: 0px; font-size: 16px; font-weight: 700; vertical-align: baseline; background: 0px 0px rgb(255, 255, 255); font-family: Roboto, sans-serif; color: rgb(33, 37, 41); line-height: 24px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; text-align: justify;"><strong style="box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: 0px 0px; font-size: inherit; line-height: inherit;">Chơi game thông minh hơn với chip AI chuyên dụng</strong></h3><p style="box-sizing: inherit; margin: 0px 0px 11px; padding: 0px; border: 0px; font-size: 16px; font-weight: 400; vertical-align: baseline; background: 0px 0px rgb(255, 255, 255); color: rgb(73, 80, 87); line-height: 24px; font-family: Roboto, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; text-align: justify;">Hành trình chơi game của bạn sẽ trở nên trơn tru hơn nhờ hệ thống trí tuệ nhân tạo Lenovo AI Engine+ thông minh. Không chỉ dừng lại ở phần mềm, con chip chuyên dụng AI LA1 sẽ giúp bạn đơn giản hóa mọi sự phức tạp. Thay vì phải loay hoay thiết lập các tùy chọn cho từng tựa game, AI sẽ tinh chỉnh cấu hình tự động và cài đặt tối ưu để hiệu suất CPU, GPU đạt hiệu quả tốt nhất. AI Engine+ của Lenovo dễ dàng khai phá tiềm năng chơi game cho chiếc máy tính Lenovo Gaming Legion 5 16IRX9 của bạn.</p><p style="box-sizing: inherit; margin: 0px 0px 11px; padding: 0px; border: 0px; font-size: 16px; font-weight: 400; vertical-align: baseline; background: 0px 0px rgb(255, 255, 255); color: rgb(73, 80, 87); line-height: 24px; font-family: Roboto, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; text-align: center;"><img alt="Lenovo Gaming Legion 5 16IRX9 (ảnh 5)" class="" src="https://images.fpt.shop/unsafe/filters:quality(90)/fptshop.com.vn/Uploads/images/2015/0511/Lenovo-Gaming-Legion-5-16IRX9-7.jpg" style="box-sizing: inherit; margin: 0px auto; padding: 0px; border: 0px; font-size: 16px; font-weight: 400; vertical-align: middle; background: 0px 0px; max-width: 100%; border-radius: 6px; width: 665px; height: auto !important; display: block;"></p></strong></p></div></div>')
